  public printData(data: any) {
    const img = this.urlImage + data.image;
    this.getDataUri(img, data, this.createPDF);
  }

  public getDataUri(url: string, data: any, callback: any) {
    const image = new Image();
    const that = this;

    image.setAttribute('crossOrigin', 'anonymous'); //getting images from external domain
    image.onload = function () {
      const canvas = document.createElement('canvas');
      let scale = Math.min(that.naturalWidth / canvas.width, that.naturalHeight / canvas.height);
      let iwScaled = canvas.width * scale;
      let ihScaled = canvas.height * scale;

      canvas.width = iwScaled;
      canvas.height = ihScaled;

      //next three lines for white background in case png has a transparent background
      var ctx = canvas.getContext('2d');
      ctx?.drawImage(image, 0, 0, iwScaled, ihScaled);
      callback(canvas.toDataURL('image/jpeg'), data);
    };
    image.src = url;
  }

  public createPDF(image: any, data: any) {
    // console.log(image, data)
    const doc = new jsPDF();
    var logoSut = 'data:image/png;base64,';

    var logoShc = 'data:image/png;base64,'

    // font sut
    var fontsut = '';
    doc.addFileToVFS('SUT Regular ver 1.00-normal.ttf', fontsut);
    doc.addFont('SUT Regular ver 1.00-normal.ttf', 'SUT Regular ver 1.00', 'normal');
    doc.setFont("SUT Regular ver 1.00");
    // var font = doc.getFont();
    // debugger;
    doc.addImage(logoSut, 'JPEG', 80, 10, 17, 20);
    doc.addImage(logoShc, 'JPEG', 100, 10, 22, 22);
    doc.setFontSize(20);
    doc.text('สถานกีฬาและสุขภาพ มหาวิทยาลัยเทคโนโลยีสุรนารี', 50, 40);
    doc.setFontSize(18);
    doc.text('สลิปโอนเงินค่าสมาชิก ' + data.name_type, 55, 50);
    doc.text('รหัสสมาชิก: ' + data.user_id, 55, 58);
    doc.text('ชื่อ-สกุล: ' + data.user_name, 55, 66);
    doc.text('ประเภท: ' + data.user_type, 55, 74);
    doc.text('จำนวนเงิน: ' + data.price + ' บาท', 55, 82);
    doc.addImage(image, 'jpg', 50, 90, 100, 180);
    doc.output("dataurlnewwindow");
  }
